import { StyleSheet, Text, View } from "react-native";
import React from "react";
import { Entypo } from "@expo/vector-icons";

const CameraPage = () => {
  return (
    <View style={styles.bgContainer}>
      <View style={styles.headerContainer}>
        <Entypo name="cross" size={24} color="black" />
        <Text style={styles.headerText}>WHAT ARE YOU OFFERING?</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  bgContainer: {
    flex: 1,
    backgroundColor: "#D2C6C6",
  },
  headerContainer: {
    flexDirection: "row", // Align children elements horizontally
    backgroundColor: "#8A7A7A",
    height: 52,
    alignItems: "center", // Center children elements vertically
    shadowColor: "#000000",
    shadowOffset: {
      width: 0,
      height: 3,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
    paddingHorizontal: 20, // Add padding to create space between icon and text
  },
  headerText: {
    color: "#FFFFFF",
    fontSize: 15,
    textAlign: "center",
    marginLeft: 50, // Add margin to separate icon and text
  },
});

export default CameraPage;
